import React from "react";

const LobbyScreen=()=>{
    return(
        <div>
            <h1>Lobby</h1>
            <form>
                <label htmlFor="email">Email Id</label>
                <input type="email" id="email"/>
                <label htmlFor="room">Room Num</label>
                <input type="email" id="room"/>
            </form>
        </div>
    )
}

export default LobbyScreen;
